{% extends "asm.s.tpl" %}
{% block code %}
    @ Prepare cycle counter timer address
    ldr.w  r0, dwt

    b.w    tested_code
.thumb_func
end_label:
{% endblock %}

{% block after %}
{{ section(code) }}
.align 4
.thumb_func
.type tested_code, %function
tested_code:
    mov.w r1, 0    @ current index
    ldr.w r2, =aValues
    ldr.w r3, =bValues
    movw r11, #{{ registerValues|length }}

loop_begin:
    cmp.w r1, r11
    bne.n loop_body
    b.w end_label

.ltorg

loop_body:
    @ Clear flags
    mov.w r7, #0
    msr.w apsr_nzcvq, r7

    @ Load input values
    ldr.w r6, [r2, r1, LSL 2]
    ldr.w r7, [r3, r1, LSL 2]

    @ Align and clear pipeline
    .align 4
    isb.w

    @ Get start time
    ldr.w r4, [r0, {{ CYCCNT }}]

    sdiv.w r5, r6, r7

    @ Get end time
    ldr.w r8, [r0, {{ CYCCNT }}]

    bl.w save

    @ Increase counters
    add.w r1, 1
    b.w loop_begin

save:
    mrs.w r7, apsr
    sub.w r4, r4, r8

    @ Save computed values
    {{saveValue('results', r5, r9, r10)}}
    {{saveValue('times', r4, r9, r10)}}
    {{saveValue('flags', r7, r9, r10)}}

    bx.n lr

.ltorg


{{ section("flash") }}

aValues:
{% for (r6Value, _) in registerValues %}
    .word {{ r6Value }}
{% endfor %}

bValues:
{% for (_, r7Value) in registerValues %}
    .word {{ r7Value }}
{% endfor %}
{% endblock %}
